    settext(event.target.value);
  }

  return(
    <>
    <div className='main_div'>
      <div className='center_div'>
        <br />
        <h1>ToDo List</h1>
        <br />
        <input type="text" placeholder='Add items' onChange={write}  />{text} <input/>
        <button> + </button>
        <ol>
          <li> Buy Apple </li>
        </ol>
      </div>
    </div>

    </>
  )
}
export default App;
